import { Paper } from "@material-ui/core";
import React from "react";
import useStyles from "./styles";

const Form = () => {
	const classes = useStyles();
	const handleSubmit = () => {};
	return (
		<Paper className={classes.paper}>
			<form
				autoComplete="off"
				noValidate
				className={classes.form}
				onSubmit={handleSubmit}
			></form>
		</Paper>
	);
};

export default Form;
